import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faLinkedin, faGithub, faInstagram} from '@fortawesome/free-brands-svg-icons'

function SocialBar(props) {
  return (
    <div class="social-links">
      <a href="https://www.linkedin.com/in/william-pepera-15978598/" target="_blank"><FontAwesomeIcon icon={faLinkedin} /></a>
      <a href="https://github.com/Sanechoic" target="_blank"><FontAwesomeIcon icon={faGithub} /></a>
      <a href="https://www.instagram.com/williambuilds/" target="_blank"><FontAwesomeIcon icon={faInstagram} /></a>
    </div>
  );
}

export default SocialBar;
